import { Button } from '@mui/material';
import React, { useState } from 'react'

function A() {
    const [count, setCount]=useState(0)
    function increment(){
        setCount(count+1);
    }
    return(
        <div>
            <Button variant="contained" onClick={increment}>A {count} Times Clicked</Button>
        </div>
    );
}
export default A;
